funcSearch:
  function funcSearch() {
    log("funcSearch");
    const els = window["tbody-reservation"].gtn("tr");
    log("els", els, els.length);

    const result = [];
    const dictCourse = {
      이스트: "EAST",
      웨스트: "WEST",
      사우스: "SOUTH",
    };
    Array.from(els).forEach((el) => {
      if(el.children.length < 3) return true;
      const param = el.children;
      const elDate = "20" + param[0].str().rm("/");
      const elTime = param[1].str().rm(":");
      const elCourse = param[2].str().regex(/[^가-힣]/g);
      log("reserve search", dictCourse[elCourse], elDate, elTime);
      result.push({ date: elDate, time: elTime, course: dictCourse[elCourse] });
    });
    const param = {
      golf_club_id: "b8802aa3-cdb5-11ec-a93e-0242ac11000a",
      device_id: "${deviceId}",
      result,
    };
    const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
    post(addr, param, { "Content-Type": "application/json" }, (data) => {
      console.log(data);
      LOGOUT();
    });
  }
